import React from "react";
import { NavHashLink } from "react-router-hash-link";

const Navfooter = () => {
  return (
    <nav className="footernav">
      <a href="https://www.instagram.com/commeospa/" target="">
        <img src="https://i.goopics.net/dmxubf.png" className="instafooter" />
      </a>
      <NavHashLink>Télécharger ma carte de visite</NavHashLink>
      <NavHashLink>Mentions légales</NavHashLink>
      <NavHashLink>Politique de confidentialité</NavHashLink>
    </nav>
  );
};

export default Navfooter;
